PLOT: 
The scene is set in an home for well off old people. But &quot;Semper Vivax&quot; is not just another retirement home. What its guests get there, which they would not in an ordinary establishment, is actually amazing : their best real-life memories are played out for them. Such is the bet of Axel, the cynical manager, and of Pipo, his assistant of genius, who are prepared to do anything to keep the customer satisfied. The only trouble is that there is nobody out there to turn into dreams the frustrations of the two men.              

